import React from "react";
import {Navbar, Nav, Button, Form} from 'react-bootstrap';
import {Link} from "react-router-dom";
class NavbarMenu extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div>
                <Navbar collapseOnSelect expand="lg" expand="md" bg="dark" variant="dark">
                    <Navbar.Brand className="ml-3" href="#home">Fou Market</Navbar.Brand>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                    <Navbar.Collapse id="responsive-navbar-nav">
                        {/* <Nav className="mr-auto" /> */}
                        <Nav className="mt-3 ml-5 mr-auto">
                            <Form>
                                <Form.Group style={{width:'750px'}} controlId="Search">
                                    <Form.Control type="email" placeholder="Search..." />
                                </Form.Group>
                            </Form>
                        </Nav>
                        <Nav>
                            <Nav.Link><Button>Panier</Button></Nav.Link>
                        </Nav>
                        <Nav>
                            { localStorage.getItem("user") === null &&
                            <div>
                                <Link to="/signin"><Button>login</Button></Link>
                                <Link to="/register"><Button>register</Button></Link>
                            </div>
                                
                            }
                            { localStorage.getItem("user") !== null &&
                                <Link to="/"><Button onClick={() => {localStorage.clear()}}>Deconnect</Button></Link>
                            }
                            
                        </Nav>
                        
                        
                    </Navbar.Collapse>
                </Navbar>
            </div>
        )
    }
}

export default NavbarMenu;
